import React, { Component } from 'react';
import './heading.css'

class Heading extends Component {
    render() { 
        return ( 
            <header>
                <nav className="navigation">
                    <div>
                        <img src={teamLogoImg}></img>
                    </div>
                    <div>
                        <ul>
                            <li>
                                <a href='/'>Home</a>
                            </li>
                            <li>
                                <a href='/'>Documents</a>
                            </li>
                        </ul>
                    </div>
                </nav>
            </header>
         );
    }
}
const teamLogoImg = require('./court-logo.jpg');
export default Heading;
